import React from 'react';

export default function Project() {
    return (
    <section id="projects" className="projects">
      <h2>To access my projects</h2>
      <div className="project-list" style={{
    backgroundImage: 'url(https://media3.giphy.com/media/yyPNLtrHSwbIOsoF6B/giphy.gif?cid=6c09b952xuc6se4wd5o9t1h6nsz5dek9dn5cr5rpjng23djh&ep=v1_internal_gif_by_id&rid=giphy.gif&ct=s)',
    backgroundSize: 'cover', // GIF'i butonun tamamını kaplayacak şekilde ayarladık
    backgroundPosition: 'center', // GIF'i ortaladık
    backgroundRepeat: 'no-repeat', // GIF'in tekrarlanmaması gerektiğini belirledik
    height: '50px', // Buton boyutunda yükseklik
    width: '150px', // Buton boyutunda genişlik
    border: 'none', // Butonun kenarlarını kaldırdık (isteğe bağlı)
    borderRadius: '5px', // Köşeleri yuvarladık (isteğe bağlı)
    cursor: 'pointer', // Buton gibi tıklanabilir olduğunu belirledik
  }}>
      
          <h3></h3>
          <p>Project Description</p>
        
       
      </div>
    </section>
  );
}
